	SET @TimeOutDTR = (SELECT TimeOut FROM dailytimerecord WHERE DailyTimeRecordId = @DailyTimeRecordId);
	
	IF(@DailyTimeRecordId != '') THEN
		if(@TimeIn = 'Y') then
			UPDATE dailytimerecord SET
			TimeIn = 'OB',
