			WHERE
			DailyTimeRecordId = @DailyTimeRecordId;
		end if;
		IF(@BreakOut = 'Y') THEN
			if(@TimeOutDTR = '') then
				UPDATE dailytimerecord SET
				BreakOut = 'OB',
				OfficialBusinessCount =  1,
				DaysWorkCount =  0.50
				WHERE
				DailyTimeRecordId = @DailyTimeRecordId;
			else
				UPDATE dailytimerecord SET
				BreakOut = 'OB',
				OfficialBusinessCount =  1,
				DaysWorkCount =  1
				WHERE
				DailyTimeRecordId = @DailyTimeRecordId;
			end if;
		END IF;
		IF(@BreakIn = 'Y') THEN
			UPDATE dailytimerecord SET
			BreakIn = 'OB',
			OfficialBusinessCount =  1
			WHERE
			DailyTimeRecordId = @DailyTimeRecordId;
		END IF;
		IF(@TimeOut = 'Y') THEN
			UPDATE dailytimerecord SET
			TimeOut = 'OB',
			OfficialBusinessCount =  1,
			DaysWorkCount =  1
			WHERE
			DailyTimeRecordId = @DailyTimeRecordId;
		END IF;
	else		
		/*if the theres no dtr*/
		IF(@TimeIn = 'Y' and @BreakOut = 'Y' and @BreakIn = 'Y' and @TimeOut = 'Y') THEN
			INSERT INTO dailytimerecord SET
