			EmployeeNo = @EmployeeNo,
			TimeIn = 'OB',
			BreakOut =  'OB',
			BreakIn = 'OB',
			TimeOut = 'OB',
			DaysWorkCount =  1,
			OfficialBusinessCount = 1;
		else 
			if(@TimeIn = 'Y' AND @BreakOut = 'Y') then
				INSERT INTO dailytimerecord SET
