DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `spInsertSequence`(pTable varchar(30),
					pOutletCode varchar(30),
					pPrefix varchar(30),
					pLength int(10),
					pLastNumber int(12),
					pUsername VARCHAR(30),
					pHostname VARCHAR(15))
BEGIN
	DECLARE  Stat VARCHAR(10);
	    SET Stat = 'Deleted';
	IF(pHostname = 'Restore') THEN
